// CREATE USERS
async function createUsers() {
    for (let index = 0; index < 100; index++) {
        if (!User || typeof (User) !== "function") { return }

        const username = "User" + Math.floor(Math.random() * 200000)
        
        const email = username + "@wilco.com"
        const password = "password" + Math.random() * 10000
        const bio = wordGenerator(30)


        const user = new User()
        user.username = username
        user.email = email
        user.password = password
        user.bio = bio

        console.log("USER: \n", user)
        await user.save()
    }
}


//CREATE ITEMS



async function createItems() {
    for (let index = 0; index < 100; index++) {
        if (!Item || typeof (Item) !== "function") { return }
        const title = wordGenerator(5)
        const slug = title + Math.random() * 1000
        const description = wordGenerator(15)
        const sellers = Array.from(User.find({}))
        const seller = sellers[index]

        const item = new Item()
        if (!item) {
            console.error("item is falsy")
        }
        item.title = title
        item.slug = slug
        item.description = description
        item.seller = seller

        console.log("Item: \n", item)
        await item.save


    }
}



async function createComments() {
    for (let index = 0; index < 100; index++) {
        const comment = new Comment()
        const sellers = Array.from(await User.find({}))
        const seller = sellers[index]

        const items = Array.from(await Item.find({}))
        const item = items[index]

        if (!seller) {
            console.error("No seller for comment")
        }
        if (!item) { console.error("No Item for comment") }
        comment.seller = seller
        comment.item = item

        console.log(comment)
        comment.save()
    }
}

